import React from 'react'
import Timer from './Timer'

const TokenSale = () => {
  const timerData = [{id:'1',time: 0, text: 'days'}]
  return (
    <>
    {timerData.map((data)=><Timer key={data.id} time={data.time} text={data.text}/>)}

    </>
  )
}

export default TokenSale
